import React from "react";

const Highlights = () => {
  return (
    <div className="highlights">
      <h1>Highlights</h1>
      <p>
        Explore standout moments from Mario’s career — goals, assists, and crucial plays that define his style of play.
        Whether it’s a well-placed pass or a clinical finish, Mario's highlights speak to his growing influence in the game.
      </p>
    </div>
  );
};

export default Highlights;
